  03> BORTHWICK, Shamus James
  b 24.11.1968
  Shamus b. at Masterton. Address: "Waitui", RD 10, Masterton.
  Shamus is a sheep and cattle farmer at "Waitui" and also has a herd of Angus cattle.
  04> BORTHWICK, Hamish Charles m on 05.06.1965 to CAMERON, Anne Florence
  b 31.01.1940
  b 08.03.1938
  Hamish b, at Masterton and m, at Brisbane, Australia, Anne, d/o Edward Dixon Cameron and Jeane Marion
  Gardiner. Address: 27 Coronation Avenue, Nambour 4560, QInd, Australia.
