  04>' WILLIAMS, Joan Elfie m on 11.12.1937 to DILLON, Patrick Philip Lee
  b 04.04.1913
  b 18.01.1912 d 02.10.1993
  Joan b. at Masterton and m, at Wellington. Patrick, s/o Francis Noel Dillon and Mildred Edith Fell, b. at
  Wellington. Address: 20 Snowdon Road, Christchurch 5.
  Joan was educated at Woodford House and Patrick was educated at Stowe School, England. Pat returned to New
  Zealand in 1931 and farmed "Leefield", Blenheim. This was the remaining 4,500 acres of a 100,000 acre block
  first taken up about 1845. Pat was Chairman of the Sheepowners' Federation in Marlborough and a founder
  member of Federated Farmers. Pat and Joan farmed "Leefield" until they retired in 1973 to live in
  Christchurch.
  01> DILLON, Rachel Anne m on 26.08.1966 to SAVORY, Robert
  b 16.02.1939
  b 15.03.1936
  Rachel 6. at Masterton. Robert, s/o Christopher Savory (1903-1987) and Daphne Tomasina Leaning
  (1909-1979), b. at St Albans, England. Address: Bengeo Hall, Hertford, Hertfordshire, England.
  Rachel was educated at Renwicktown School, Selwyn House, Christchurch and Chilton Saint James, Lower
  Hutt (sports captain, prefect 1956). She worked at Stoneyhurst, for the Douglas Cliffords' General
  Trading Co and at Elworthys' at Craigmore, Timaru before going to England in 1961. There she trained as
  a florist and worked at the Dorchester Hotel Flower Shop. After marriage to Robert they lived at Knoll
  House, High Cross, Ware, Hertfordshire where they had 6 acres and Rachel established a flock of sheep.
